New LJ look!!!!! after some work I came out with smth that looks pretty good .. or at least that's what i think lol... and it's Beauty Pop AGAIN  !!! xD this is not the usual characters like the one before but a waaaaaaay cuter version hahahah... and yeah pink is back xD;;; hahaha this version of BP is taking over my life.. i made LJ look, cellphone wallpaper and screensaver and even a compy wallpaper ^^;;;;

Life.. not bad.. not busy.. still working only weekends.. love it though.. but i need a new job =/... I'm wasting my life staying at home Dx... 

oh well... not much to say today.. maybe my eyes hurt again from so much computer ^^;;;;


*many huggles &lt;3*

hello everyone I hope you are all doing good.. About me... well same old me different country...&nbsp;

France is so pretty (so far) xp.. i really like it here with the exeption of the keybords from hell and the lack of adaptors and 24h internet...&nbsp; the food.. well i haven't had much traditional food.. desserts are awesome though XD &lt;3&lt;3&lt;3&lt;3

That's all for today again DX ;;&gt;.&gt; maybe i shopuld type these in my room DX *stabs keybord*

Quick pre-departure message...

Well Everyone thanks for all your messages.. sorry I didn't answer to them .. but in my defense I've been busy &gt;.&lt; getting ready for a 2 month trip to an unknown land (&lt;-- that sounds way too dramatic lol).. is not easy.. but I've to go tomorrow first thing in the morning so ready or not I'm going XD;;

About my wallpaper .. I got it to session zero of Animepaper again... but i didn;t have time to fix anything from it.. so it'll be stuck there for a while ^^;;;

Other than that not much to say..

I hope you all have super mega wow summers .. I hope that the weather wherever you are stays nice and warm all summer ( but not to warm ^_~) that you have fun, that you meet lots of new friends and that you learn a lot about anything you are interested in ^__^ and take care !! &lt;3

I'll post as soon as I can..&nbsp; matta ne..

yey i finally got a new look for my lj <3 i was wanting to change my "a hundred years of snow one" because i made it for halloween ^^;; not xmas though it kinda worked too its a story related to.. well winter.. and snow.. but still .. a vampire pic for xmas feels a bit weird ^^;;

So i made this one ^^ the pic is from Hanakimi ^^.. i never would have expected to make a Hanakimi look for lj.. but the pic is very pretty and then again i need pics easy to edit because i only have paint ;;>.>   and it ended up lovely... in my opinion ^^;

now.. back to making dinner .. (yup at 10:50pm ;;;;;;;>.>)
